import { useEffect } from "react";

function App() {
  useEffect(() => {
    fetch("http://localhost:3000/movies")
      .then((r) => r.json())
      .then((movies) => console.log(movies));
  }, []);

  return <h1>Hello from React!</h1>;
}

export default App;
